import React from 'react';
import { BrowserRouter, Route, Routes } from "react-router-dom";

import SignUp from "./components/sign_up";

// Other imports...

function App() {
  return (
    <BrowserRouter>
        <Routes>
        <Route path="signup/" element={<SignUp />} />

          {/* Other routes */}
        </Routes>
    </BrowserRouter>
  );
}

export default App;
